Lib.Table={Matches=function(a,b,c)if type(b)~="table"or type(c)~="table"then return b==c end;for d,e in pairs(b)do if c[d]==nil then return false end;if type(e)=="table"then if not Lib.Table.Matches(a,e,c[d])then return false end else if e~=c[d]then return false end end end;for d,e in pairs(c)do if b[d]==nil then return false end;if type(e)=="table"then if not Lib.Table.Matches(a,e,b[d])then return false end else if e~=b[d]then return false end end end;return true end,Type=function(a,f)if not next(f)then return"empty"end;local g=true;local h=false;for d in pairs(f)do if type(d)~="number"then g=false;break else h=true end end;return g and"array"or(h and"mixed"or"object")end}